import React,{ Component} from 'react';
// import RangeBarChart from "./views/column charts/Range Bar Chart";
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import SignUp from './components/signup.component';
import Login from './components/login.component';

class App extends Component {
  render() {    
    return (
      // <Router>
      //     <div>
      //       <h2> <span>&nbsp;&nbsp;&nbsp;&nbsp;Transformer</span></h2>
      //       <nav className="navbar navbar-expand-lg navbar-light bg-light">
      //       <ul className="navbar-nav mr-auto">
      //         <li><Link to={'/topology'} className="nav-link"> Topology </Link></li>
      //         <li><Link to={'/energybalance'} className="nav-link">Energy balance </Link></li>
      //         <li><Link to={'/voltage'} className="nav-link">Voltage </Link></li>
      //       </ul>
      //       </nav>
      //       <hr />
      //       <Switch>
      //           <Route exact path='/topology' component={RangeBarChart} />
      //       </Switch>
      //     </div>
      //   </Router>
      <Router>
        <div className="App">
          <nav className="navbar navbar-expand-lg navbar-light fixed-top">
            <div className="container">
              <Link className="navbar-brand" to={"/sign-in"}>positronX.io</Link>
              <div className="collapse navbar-collapse" id="navbarTogglerDemo02">
                <ul className="navbar-nav ml-auto">
                  <li className="nav-item">
                    <Link className="nav-link" to={"/sign-in"}>Login</Link>
                  </li>
                  <li className="nav-item">
                    <Link className="nav-link" to={"/sign-up"}>Sign up</Link>
                  </li>
                </ul>
              </div>
            </div>
          </nav>

          <div className="auth-wrapper">
            <div className="auth-inner">
              <Switch>
                <Route exact path='/' component={Login} />
                <Route path="/sign-in" component={Login} />
                <Route path="/sign-up" component={SignUp} />
              </Switch>
            </div>
          </div>
        </div>
      </Router>

      );
  }
}

export default App;
